import logo from './logo.svg';
import './App.css';
import Menu from "./components/Menu";
import { Container, Row } from 'reactstrap';
import Header from "./components/Header";

function App() {
  return (
    <div >
      <Menu />
      <Container>
        <Header />
        <Row>
          <Col md={4}>
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default App;
